import axios from 'axios';

export function getEnderecoPorCep({cep, lista}){
    try {

       axios.get(`https://viacep.com.br/ws/${cep}/json/`).then((response) =>{
         console.log(response.data);
         lista.push(response.data.cep)
       });
    } catch (error) {

      console.error(error);
    }
  }
